B.UE=new A.d0("Sogniario \xe8 un'app creata per registrare e catalogare i tuoi sogni.\n\nPrende nota della qualit\xe0 del tuo sonno e delle caratteristiche dei tuoi sogni. Inoltre registra vocalmente la descrizione del tuo sogno.\n\nAnalizza la complessit\xe0 del sogno attraverso tecniche di neurolinguistica e riporta grafi e nuvole di parole per una visualizzazione intuitiva del contenuto del sogno. Permette di tener traccia della qualit\xe0 del tuo sonno e dei sogni mediante la funzione calendario.\n\nSogniario nasce da una collaborazione tra il Brain and Sleep Research Laboratory dell\u2019Universit\xe0 di Camerino e il Molecular Mind Laboratory della Scuola IMT Alti Studi Lucca. Ha lo scopo di aiutare gli scienziati a comprendere il funzionamento del cervello alla base dell\u2019esperienza cosciente durante il sonno.",null,null,B.cS,null,null,null,null,null,null,null)
